import React, { Component } from 'react';

class Input extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
    };
  }

  onChangeInput(event) {
    this.setState({ name: event.target.value });
  }

  render() {
    return (
      <input
        type="text"
        className={this.props.classprop}
        onChange={(event) => this.onChangeInput(event)}
      ></input>
    );
  }
}
export default Input;
